import { useNavigate, useLocation } from "react-router-dom";
import styles from './Button.module.scss'
import classNames from 'classnames/bind';

const cx= classNames.bind(styles)
function ButtonChangePage({page,label}) {
    const navigate = useNavigate();
    const location = useLocation();
    const isActive = location.pathname === page; // Kiểm tra trang hiện tại
    const handleClick = () => {
        console.log("Navigating to:", page); // Kiểm tra xem page có giá trị không
        navigate(page);
    };

    return (
        <button className={cx('btn-manage')} onClick={(handleClick) }>{label}</button>
    );
}

export default ButtonChangePage;
